//     </Link>
//     <Link href="/about">
//       <a style={linkStyle}>About</a>
//     </Link>
//   </div>
// );

const Navbar = () => {
  return (
    <div id="body">
      <div id="NavMenu">
        <Link href="/">
          <a id="logo">Jobaho</a>
        </Link>
        <Link href="/">
          <a id="navbarmenu">Home</a>
        </Link>
        <Link href="/">
          <a id="navbarmenu">About Us</a>
        </Link>
        <Link href="/">
          <a id="navbarmenu">Find a Job</a>
        </Link>
      </div>
      <style jsx>{`
        .body {
          margin: 50px 50px 0px 50px;
        }
      `}</style>
    </div>
  );
};

export default Navbar;
